function SaveAsDashboardExtension(n){var t=this;this._control=n;this._toolbox=this._control.findExtension("toolbox");this._newDashboardExtension=this._control.findExtension("create-dashboard");this._menuItem={id:"dashboard-save-as",title:"Save As...",template:"dx-save-as-form",selected:ko.observable(!0),disabled:ko.computed(function(){return!n.dashboard()}),index:112,data:t};this.saveAs=function(){this.isExtensionAvailable()&&(this._toolbox.menuVisible(!1),this._newDashboardExtension.performCreateDashboard(this.newName(),this._control.dashboard().getJSON()))};this.newName=ko.observable("New Dashboard Name")}SaveAsDashboardExtension.prototype.isExtensionAvailable=function(){return this._toolbox!==undefined&&this._newDashboardExtension!==undefined};SaveAsDashboardExtension.prototype.start=function(){this.isExtensionAvailable()&&this._toolbox.menuItems.push(this._menuItem)};SaveAsDashboardExtension.prototype.stop=function(){this.isExtensionAvailable()&&this._toolbox.menuItems.remove(this._menuItem)};